import React from "react";
import ReactDOM from "react-dom";
import { useParams } from "react-router-dom";

function NotFound() {
  return (
    <>
      const {params} = useParams();
      <h1>404</h1>
      <h3>The site {params} is not available :(</h3>
    </>
  );
}

export default NotFound;
